import React from 'react';
import UplodBtn from '../../General/UploadFile/upload.js'
import Gallery from './gallery.js'

class Content extends React.Component{
  render() {
    return
    (
      <div>
        <UplodBtn/>
        <Gallery data={this.props.data}/>
      </div>
    )
  }
}
export default Content;
